import React,{ Component } from 'react'
import {Link} from 'react-router-dom';
import image3 from '../images/image3.jpeg'
import image4 from '../images/image4.jpeg'
import image5 from '../images/image5.jpeg'
class Meditationex extends Component {
  render() {
      return (
       <div style={ImgDiv}>       <div className= 'float center text-center pb-5 text-color'>
        <h3 style={{color:"white"}} ><u>WHAT IS IN YOUR MIND</u></h3>
        </div>
       <div className= 'row pt-5'>
       <div className=' col text-center pt-5 border   '  style={{ marginLeft:"40px" ,marginRight:"40px",height:"350px" ,borderStyle:"solid", backgroundColor:"grey",borderRadius:"20px", boxShadow: "0 10px 12px 0 rgba(0, 0, 0, 0.25)"}}>
         <button>Meditation</button>
       </div>
       <div className='col text-center pt-5 border pb-5'  style={{marginLeft:"40px" ,marginRight:"40px",height:"350px" ,borderStyle:"solid", backgroundColor:"grey",borderRadius:"20px", boxShadow: "0 10px 12px 0 rgba(0, 0, 0, 0.25)"}}>
         <button>Exercise</button>
       </div>
       </div>

       
        
        
        </div>



      )
  }  
}
const ImgDiv={
  backgroundImage: 'url('+image3+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"600px",
}


const ImgDiv1={
  backgroundImage: 'url('+image4+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"600px",
}

const ImgDiv2={
  backgroundImage: 'url('+image5+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"600px",
}
export default Meditationex;
